import React from 'react'
import {Link, NavLink } from 'react-router-dom';

const Navbar = () => {
    return (
        <>
            {/* Link */}
            {/* <Link to="/">About Us</Link>
            <br/>
            <Link to="/contact">Contact Us</Link>
            <Link to="/contact/Name">Name</Link> */}

            {/* NavLink */}
            <Link to="/">About Us</Link>
            <br/>
            <Link to="/contact">Contact Us</Link>
            <Link to="/contact/Name">Name</Link>
        </>
    );
}

export default Navbar;
